import{d as t,o as e,j as i}from"./vendor.257a3678.js";const a={class:"markdown-body"},l=i("<h1>Blueberry Muffins</h1><table><thead><tr><th>Prep</th><th>Cook</th><th>Difficulty</th><th>Makes</th></tr></thead><tbody><tr><td>20 mins</td><td>25 mins</td><td>Easy</td><td>20 muffins</td></tr></tbody></table><p>Nutrition: per muffin</p><table><thead><tr><th>kcal</th><th>fat</th><th>saturates</th><th>carbs</th><th>sugars</th><th>fibre</th><th>protein</th><th>salt</th></tr></thead><tbody><tr><td>205</td><td>9g</td><td>2g</td><td>28g</td><td>13g</td><td>1g</td><td>3g</td><td>0.5g</td></tr></tbody></table><h2>Ingredients</h2><ul><li>2 medium eggs</li><li>125ml vegetable oil</li><li>250ml semi-skimmed milk</li><li>250g golden caster sugar</li><li>400g self-raising flour (or same quantity plain flour and 3 tsp baking powder)</li><li>1 tsp salt</li><li>150g blueberries</li></ul><h2>Method</h2><h3>Step 1</h3><p>Heat oven to 200C/180C fan/gas 6. Line 2 muffin trays with paper muffin cases. In a large bowl beat 2 medium eggs lightly with a handheld electric mixer for 1 min.</p><h3>Step 2</h3><p>Add 125ml vegetable oil and 250ml semi-skimmed milk and beat until just combined then add 250g golden caster sugar and whisk until you have a smooth batter.</p><h3>Step 3</h3><p>Sift in 400g self-raising flour and 1 tsp salt (or 400g plain flour and 3 tsp baking powder if using) then mix until just smooth. Be careful not to over-mix the batter as this will make the muffins tough.</p><h3>Step 4</h3><p>Stir in 150g blueberries.</p><h3>Step 5</h3><p>Fill muffin cases two-thirds full and bake for 20-25 mins, until risen, firm to the touch and a skewer inserted in the middle comes out clean. If the trays will not fit on 1 shelf, swap the shelves around after 15 mins of cooking.</p><h3>Step 6</h3><p>Leave the muffins in the tin to cool for a few mins and transfer to a wire rack to cool completely.</p>",19),s={expose:[],setup:i=>(i,s)=>(e(),t("div",a,[l]))};export default s;
